import React from "react";
import ReactDOM from "react-dom";
import { BrowserRouter, Route, Switch, Redirect } from "react-router-dom";

import "@fortawesome/fontawesome-free/css/all.min.css";
import "assets/styles/tailwind.css";

// layouts

import Admin from "layouts/Admin.js";
import Driver from "layouts/"
import Auth from "layouts/Auth.js";

// views without layouts

import Landing from "views/Landing.js";
import Profile from "views/Profile.js";
import Index from "views/Index.js";
import Login from "views/auth/Login";
import Main from "views/main.js"

// let roles = ["admin","driver"]
// let dynamicRoutes = roles.map((role,index) => {
//   return({
//     role: role,
//     userId: index,
//   })
// })
ReactDOM.render(
  <BrowserRouter>
    <Switch>
      {/* add routes with layouts */}
      <Route path="/admin" component={Admin} />
      <Route path="/auth" component={Auth} />
      {/* add routes without layouts */}
      <Route path="/landing" exact component={Landing} />
      <Route path="/profile" exact component={Profile} />
      <Route path="/" exact component={Login} />
      {
        [...Array(1000).keys()].map((userId) => <Route exact path={"/driver/"+userId.toString()} component={() => <Main role="driver" userId={userId}/>}/>)
      }
      {
        [...Array(1000).keys()].map((userId) => <Route exact path={"/admin/"+userId.toString()} component={() => <Main role="admin" userId={userId}/>}/>)
      }
      {/* add redirect for first page */}
      {/* <Redirect from="*" to="/Login" /> */}
    </Switch>
  </BrowserRouter>,
  document.getElementById("root")
);
